  false,\n\t\"url\": null,\n\t\"notes\": \"The San Diego Tracking Team (SDTT) is a
  non-profit organization dedicated to promoting the preservation of wildlife habitat
  in San Diego County through citizen-based wildlife monitoring coupled with environmental
  education programs. For over 10 years, the SDTT has conducted wildlife track and
  sign surveys to evaluate the health of key species, the connectivity of open space
  areas, and the efficacy of the city and county's Multiple Species/Habitat Conservation
  Plans. Scientific advisors from public resource agencies and academic institutions
  oversee the tracking protocol, and SDTT data is used in planning transportation
  and urban development projects, as well as in studies on land use in fragmented
  habitats (Markovchick-Nicholls et al. 2008). Surveys are conducted by trained volunteers
  from all over San Diego County who together commit over 1500 hours per year to monitoring
  approximately 50 locations around the county. Transects of approximately one mile
  in length and 30 feet in width are designated on dirt trails and roads throughout
  open space lands in San Diego County. Each transect is divided up into multiple
  segments of variable length ranging from 6-1708 meters (20-5600 ft). Transect teams,
  which consist of an experienced Transect Leader and from 1 to 6 trained volunteers,
  survey transects on a seasonal basis each year. This dataset represents a summary
  of SDTT data collected from 1996-2006. Any track or sign identified from the following
  animals was recorded during surveys: coyote, mule deer, bobcat, gray fox, raccoon,
  opossum, wood rat, badger, black-tailed jack rabbit, cougar, black bear, spotted
  skunk, long-tailed weasel, ringtail and roadrunner. If a track or sign was observed,
  the location (transect number and transect section) and type of sign (scat, tracks,
  deer browse, evidence of predation, den/bed site, sighting) were recorded on data
  sheets. In addition, age of the sign (Fresh, less than two weeks old or Historic,
  more than two weeks old) was recorded. Additional data on presence of small mammals
  (cottontails, skunks, squirrels, or rodents) and habitat characteristics (i.e. topography,
  vegetation type) were recorded as well as tracking conditions.\",\n\t\"owner_org\":
